import React from "react";
import { Swiper, SwiperSlide } from 'swiper/react';

// Import Swiper styles
import 'swiper/css';
import 'swiper/css/pagination';

import './Style1.css';

// import required modules
import { Pagination } from 'swiper/modules';

export default function Main() {
  return (
    <div>
      
      {/* ------------------ about */}

      <div className="about">
        <div style={{ marginTop: "150px", display: "flex",justifyContent:'center',marginBottom:'100px'}}>
          <div style={{paddingTop:'40px',paddingRight:'250px'}}>
            <h2 style={{fontSize:'40px',fontWeight:'700',textAlign:'start'}}>About Elsoobat</h2>
            <p style={{fontSize:'12px',textAlign:'start',marginTop:'40px'}}>
              Established on April 24, 2019, under the leadership of <br /> Chairman
              Hisham Hassan Mohammed Ahmed Ali, Elsoobat is <br /> a proud member of
              the prestigious El Soobat Group.</p>
              <p style={{fontSize:'12px',textAlign:'start'}}>Our team of seasoned
              professionals in petroleum and <br /> agriculture ensures top-tier
              services and products, adhering <br /> strictly to environmental and
              health regulations.
            </p>
            <div style={{display:'flex',marginTop:'40px'}}>
              <p style={{fontWeight:'600',fontSize:'22px',textAlign:'start',paddingRight:'100px'}}>100 % <br /> Compliance</p>
            <p style={{fontWeight:'600',fontSize:'22px',textAlign:'start'}}>UAE <br /> Based</p>
            </div>
            <button style={{border:'1px solid #003C82',borderRadius:'25px',width:'150px',height:'45px',backgroundColor:'white',color:'#003C82',fontWeight:'600',marginRight:'180px',marginTop:'20px'}}>Contact Us</button>
          </div>
        
        <div style={{ height: "450px", width: "380px",border:'1px solid #003C82',padding:'15px',borderRadius:'20px' }}>
          <img
            src="/images/refuel.jpg"
            alt=""
            style={{ width:'100%',height:'100%',borderRadius:'12px'}}
          />
          </div>
          </div>
      </div>


      {/* ------------------ about */}

      {/* ------------------ carousel */}

      
        <Swiper
        slidesPerView={4}
        centeredSlides={true}
        spaceBetween={30}
        grabCursor={true}
        className="mySwiper"
      >
        <SwiperSlide>
          <h2>Our Services</h2>
          <p>We provide comprehensive solutions for petroleum derivatives and agricultural products, tailored to meet the evolving needs of industries and businesses. From high-performance oils, lubricants, and fuels to premium-quality grains and edible oils, our product range is designed to ensure reliability.</p>
        </SwiperSlide>
        <SwiperSlide><img src="/images/wheatfield.jpg" alt="" /></SwiperSlide>
        <SwiperSlide><img src="/images/whitebowl.jpg" alt="" /></SwiperSlide>
        <SwiperSlide><img src="/images/goldenoil.jpg" alt="" /></SwiperSlide>
      </Swiper>


      {/* ------------------ carousel */}


    </div>
  );
}
